import React from "react";
import DataItem from "./dataItem";

function Collapsible(){
  return (
    <div className="collapsible">
      <DataItem type="column-div" item1 = "Ф.И.О:"/>
      <DataItem type="column-div" item1 = "Ҳайдовчи гувоҳномаси:"/>
      <DataItem type="column-div" item1 = "Тоифаси:"/>
      <DataItem type="column-div" item1 = "Автомобил рақами:"/>
      <DataItem type="column-div" item1 = "Асосий Шофер:"/>
    </div>
  );
}

export default Collapsible;
